namespace RonSijm.FluidHumidifier.Factories.AppFlow;

public class FlowFactory(string resourceName = null, Action<Humidifier.AppFlow.Flow> factoryAction = null) : ResourceFactory<Humidifier.AppFlow.Flow>(resourceName)
{

    internal List<InnerFlowTaskFactory> TasksFactories { get; set; } = [];

    internal List<InnerFlowDestinationFlowConfigFactory> DestinationFlowConfigListFactories { get; set; } = [];

    internal InnerFlowTriggerConfigFactory TriggerConfigFactory { get; set; }

    internal InnerFlowSourceFlowConfigFactory SourceFlowConfigFactory { get; set; }

    internal InnerFlowMetadataCatalogConfigFactory MetadataCatalogConfigFactory { get; set; }

    protected override Humidifier.AppFlow.Flow Create()
    {
        var flowResult = CreateFlow();
        factoryAction?.Invoke(flowResult);

        return flowResult;
    }

    private Humidifier.AppFlow.Flow CreateFlow()
    {
        var flowResult = new Humidifier.AppFlow.Flow
        {
            GivenName = InputResourceName,
        };

        return flowResult;
    }
    public override void CreateChildren(Humidifier.AppFlow.Flow result)
    {
        base.CreateChildren(result);

        result.Tasks = TasksFactories.Any() ? TasksFactories.Select(x => x.Build()).ToList() : null;
        result.DestinationFlowConfigList = DestinationFlowConfigListFactories.Any() ? DestinationFlowConfigListFactories.Select(x => x.Build()).ToList() : null;
        result.TriggerConfig ??= TriggerConfigFactory?.Build();
        result.SourceFlowConfig ??= SourceFlowConfigFactory?.Build();
        result.MetadataCatalogConfig ??= MetadataCatalogConfigFactory?.Build();
    }

} // End Of Class

